measurements.description:
Twenty-one flowers on two up to 83-cm inflorescences;
 sepals and petals olive green spotted and striped maroon;
 dorsal sepal narrowly elliptic, hooded, lateral sepals ovate, falcate;
 petals ligulate, falcate;
 lip cream, striped maroon lateral lobes, yellow cilia on keel,
 apical lobe crispate, spotted maroon, covered light yellow cilia;
 column cream, spotted maroon basally, striped maroon ventrally, anther cap white;
 substance firm; texture matte.
